import './App.css';
// import search from './myApp';
import Search from './components/Search';
import Results from './components/Results';
import { useState } from 'react';

function App() {
  const [results, setResults] = useState();
  const search = (book) => {
    fetch(`http://localhost:4000/search/${book}`)
    .then(response => response.json())
    .then(data => setResults(data));
  }
  search('pachinko');
  let resultArr = [];
  if (typeof results === 'object') {
    console.log(Object.values(results));
    resultArr = Object.values(results);
  }
  console.log(results);
  return (
    <div className="App">
      <h1>Notion Book Injector</h1>
      <Search />
      <Results />
      {results === undefined ? <div /> : results.forEach(element => {
        return <div key={element.title}><h2>{element.title}</h2></div>
      })}
    </div>
  );
}

export default App;
